// Collect all booked intervals from input items (previous node)
const bookedIntervals = [];
for (const item of $input.all()) {
  bookedIntervals.push({
    start: new Date(item.json.start.dateTime),
    end: new Date(item.json.end.dateTime)
  });
}

// Settings
const days = 30;
const workStartHour = 7;
const workEndHour = 17; // exclusive, so last slot starts at 16:30
const slotDurationMinutes = 30;

// Helper to format date to ISO8601 with +02:00
function toISOWithFixedOffset(date) {
  const pad = n => String(n).padStart(2, '0');
  return date.getFullYear() + '-' +
    pad(date.getMonth() + 1) + '-' +
    pad(date.getDate()) + 'T' +
    pad(date.getHours()) + ':' +
    pad(date.getMinutes()) + ':00+02:00';
}

// Helper to check if two intervals overlap
function isOverlapping(slotStart, slotEnd, bookedStart, bookedEnd) {
  return slotStart < bookedEnd && slotEnd > bookedStart;
}

// Get current time in +02:00 (Europe/Zurich) timezone
const now = new Date();
const nowUtc = now.getTime() + (now.getTimezoneOffset() * 60000);
const nowPlus2 = new Date(nowUtc + 2 * 60 * 60000);

nowPlus2.setSeconds(0, 0); // ignore seconds/milliseconds

let available = [];

for (let d = 0; d < days; d++) {
  for (let h = workStartHour; h < workEndHour; h++) {
    for (let m = 0; m < 60; m += slotDurationMinutes) {
      let slotStart = new Date(nowPlus2);
      slotStart.setDate(slotStart.getDate() + d);
      slotStart.setHours(h, m, 0, 0);

      let slotEnd = new Date(slotStart);
      slotEnd.setMinutes(slotEnd.getMinutes() + slotDurationMinutes);

      // Exclude slots in the past
      if (slotStart < nowPlus2) continue;

      // Check for overlap with any booked interval
      let overlaps = bookedIntervals.some(b =>
        isOverlapping(slotStart, slotEnd, b.start, b.end)
      );

      if (!overlaps) {
        available.push({ available: toISOWithFixedOffset(slotStart) });
      }
    }
  }
}

return available.map(a => ({ json: a }));
